import React from "react";
import { Routes, Route } from "react-router-dom";
import LoginPage from "./pages/auth/login";
import HomePage from "./pages/home";
import PostPage from "./pages/post";
import RegisterPage from "./pages/auth/register";
import HardwarePage from "./pages/hardware";
import SoftwarePage from "./pages/software";
import GamesPages from "./pages/games";
import InnovationsPages from "./pages/innovations";
import AiPages from "./pages/ai";
import FrontEndPage from "./pages/frontendpage";
import BackendPage from "./pages/backendpage";
import NotificationsPage from "./pages/notifications";
import GamesCatPages from "./pages/kategoriOyunlar";
import MoviesCatPages from "./pages/kategoriFilmler";
import CategoriesPage from "./pages/categories/inddx";
const App = () => {
  return (
    <Routes>
      <Route path="/login" element={<LoginPage />} />
      <Route path="/post" element={<PostPage />} />
      <Route path="/" element={<HomePage />} />
      <Route path="/register" element={<RegisterPage />} />
      <Route path="/donanim" element={<HardwarePage />} />
      <Route path="/yazilim" element={<SoftwarePage />} />
      <Route path="/oyunlar" element={<GamesPages />} />
      <Route path="/yenilikler" element={<InnovationsPages />} />
      <Route path="/yapay-zeka" element={<AiPages />} />
      <Route path="/front-end" element={<FrontEndPage />} />
      <Route path="/back-end" element={<BackendPage />} />
      <Route path="/bildirimler" element={<NotificationsPage />} />
      <Route path="/kategoriler" element={<CategoriesPage />} />
      <Route path="/kategori/:categoryName" element={<CategoriesPage />} />
      <Route path="/bildirimler" element={<GamesCatPages />} />
    </Routes>
  );
};

export default App;
